import React, { useState } from 'react';
import axios from 'axios'; // API 

const StocksProvider = {
    GetGME: function() {
        const res = axios.GET('http://localhost:8080/api/v1/stocks');
        console.log(res);
        return res;
    }
}

export default StocksProvider
